"use strict";(self.webpackChunkstatic_site=self.webpackChunkstatic_site||[]).push([[18],{18:a=>{a.exports=JSON.parse('[{"id":"0066902c-dfbc-4094-82d7-817c1e4533e0","slug":"san-mateo-county-pride-center","externalUrl":"https://sanmateopride.org/","tags":["transmasculine","non-binary","transfeminine","healthcare","mental-health","social-services"],"address":"1021 S El Camino Real, San Mateo, CA 94402, USA","phoneNumber":"650-591-0133","country":"US","provinceOrState":"CA","city":"San Mateo","county":"San Mateo County","latLng":[37.5569591,-122.3189073],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/san-mateo-county-pride-center-san-mateo","googleMapsUrl":"https://goo.gl/maps/uj5ogP9y4LboxZYD9","facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"San Mateo County Pride Center","description":"San Mateo County Pride Center adalah organisasi model kolaborasi dan pusat belanja satu atap untuk komunitas LGBTQ+. Kami menawarkan program dan layanan yang kuat untuk mendukung anggota komunitas LGBTQ+ dari segala usia, termasuk pendidikan, pelatihan, acara komunitas, kelompok dukungan sebaya, program harian, terapi klinis, dan manajemen kasus."},{"id":"0db36ba9-b329-4a54-8302-d7810866457a","slug":"diyhrtcafe","externalUrl":"https://diyhrt.cafe","tags":["transfeminine","non-binary","transmasculine","healthcare","education-awareness"],"title":"DIYHRT.cafe","description":"Sebuah komunitas online yang dinamis dan pusat pengetahuan untuk individu yang tertarik pada terapi penggantian hormon buatan sendiri (HRT). Situs web mereka didedikasikan untuk menyediakan ruang yang aman dan inklusif di mana orang dapat mengakses informasi, sumber daya, dan dukungan untuk HRT yang diadministrasikan sendiri. Apakah Anda menjelajahi metode alternatif, mencari panduan tentang dosis dan administrasi, atau hanya ingin berhubungan dengan orang-orang yang memiliki pengalaman serupa, DIYHRT.cafe menawarkan banyak wawasan berharga, kisah pribadi, dan nasihat ahli untuk membantu Anda membuat keputusan yang tepat tentang kesehatan dan kesejahteraan Anda."},{"id":"18ba5d3d-c47d-47f8-90a4-2f353a1f13ce","slug":"ftmguideorg","externalUrl":"https://FTMGuide.org","tags":["non-binary","transmasculine","healthcare","clothing"],"title":"FTMGuide.org","description":"Sebuah platform online komprehensif yang didedikasikan untuk mendukung individu yang sedang bertransisi dari wanita menjadi pria (FTM). Situs web mereka berfungsi sebagai sumber daya tepercaya, menawarkan berbagai informasi, bimbingan, dan konektivitas komunitas untuk mereka yang memulai perjalanan FTM mereka. Mulai dari saran praktis tentang terapi hormon dan opsi bedah hingga dukungan kesehatan mental dan cerita pribadi, FTMGuide.org bertujuan untuk memberdayakan individu dengan pengetahuan dan sumber daya yang mereka butuhkan untuk menjalani transisi mereka dengan percaya diri dan kejelasan."},{"id":"1e8cb769-f49b-4428-86ea-2c4cbec96905","slug":"transfemscienceorg","externalUrl":"https://transfemscience.org","tags":["transfeminine","non-binary","healthcare"],"title":"transfemscience.org","description":"Sebuah platform online yang revolusioner yang didedikasikan untuk menyediakan penelitian berbasis bukti, pendidikan, dan sumber daya untuk komunitas transgender dan non-biner, dengan fokus khusus pada terapi hormon feminisasi (FHT). Situs web mereka berfungsi sebagai pusat penting bagi individu yang mencari informasi yang dapat diandalkan dan terbaru tentang aspek medis, fisiologis, dan psikologis dari FHT. Melalui koleksi lengkap mereka dari studi yang ditinjau oleh rekan, artikel ahli, dan panduan praktis, situs mereka memberdayakan individu untuk membuat keputusan yang berdasarkan informasi tentang transisi dan kesehatan mereka."},{"id":"3b5a33bd-aba4-4205-9a86-293b172e38ee","slug":"genderdysphoriafyi","externalUrl":"https://genderdysphoria.fyi","tags":["transmasculine","non-binary","transfeminine","mental-health","support-groups","community-stories","education-awareness"],"title":"genderdysphoria.fyi","description":"Sebuah sumber daya online tepercaya untuk individu yang mencari pengetahuan, dukungan, dan pemahaman tentang disforia gender. Situs web mereka menyediakan berbagai informasi, sumber daya, dan koneksi komunitas untuk memberdayakan individu dalam perjalanan mereka. Dari panduan komprehensif tentang identitas gender dan transisi hingga cerita pribadi dan saran ahli, mereka berusaha menciptakan ruang yang aman dan inklusif untuk semua."},{"id":"4332f79d-1323-45ca-9b40-df63af9b7179","slug":"movement-advancement-project","externalUrl":"https://www.lgbtmap.org/","tags":["legal","healthcare","education-awareness"],"address":"1905 15th St #1097, Boulder, CO 80302, USA","email":null,"phoneNumber":"(303) 578-4600","country":"US","provinceOrState":"CO","city":"Boulder","county":"Boulder County","latLng":[40.0178641,-105.2763041],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/lgbtmap/","twitterUrl":"https://twitter.com/lgbtmap","instagramUrl":"https://www.instagram.com/lgbtmap/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Proyek Kemajuan Gerakan","description":"Proyek Kemajuan Gerakan (MAP) adalah think tank independen, nirlaba yang menyediakan penelitian yang ketat, wawasan, dan komunikasi yang membantu mempercepat kesetaraan dan kesempatan untuk semua orang. MAP berusaha untuk memastikan bahwa semua orang memiliki kesempatan yang adil untuk mengejar kesehatan dan kebahagiaan, mencari nafkah, merawat orang yang mereka cintai, aman di komunitas mereka, dan berpartisipasi dalam kehidupan sipil."},{"id":"43609b17-7528-4c60-94b4-e90866144715","slug":"jordan-ross-communication-services","externalUrl":"https://www.jordanrosscommunication.com/","tags":["voice-training"],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":"https://www.instagram.com/jordanrosscommunication/","youtubeUrl":"https://www.youtube.com/channel/UC4o7h219hPYdBcPaFpgh9Yw","tiktokUrl":"https://www.tiktok.com/@jordanrosscommunication","twitchUrl":null,"patreonUrl":null},"title":"Layanan Komunikasi Jordan Ross","description":"Jordan Ross menyediakan pelatihan pidato, suara dan komunikasi untuk individu trans, queer dan non-konformitas gender. Dia menawarkan pelatihan 1-On-1, kursus online, acara, dan \'Program Coaching Voice Within\'. Pendekatannya melibatkan pemrograman neuro-linguistik, hipnoterapi, instruksi yoga, dan pelatihan pernapasan, bertujuan untuk mengatasi tidak hanya aspek fisik tetapi juga mental, emosional, dan energetik dari komunikasi."},{"id":"4465cbb7-3513-41ae-8878-7a86ebbe9f6a","slug":"gender-dynamix-online-education-portal","externalUrl":"https://www.genderdynamix.org.za/","tags":["transfeminine","transmasculine","non-binary","legal","healthcare","education-awareness","support-groups","community-stories"],"address":"7, 10 Anson St, Observatory, Cape Town, 7925, South Africa","phoneNumber":"+27 (0)21 447 4797","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9368811,18.470378],"email":"info@genderdynamix.org.za","socialMedia":null,"town":"Observatory","title":"Portal Pendidikan Online Gender Dynamix","description":"Gender Dynamix adalah organisasi nirlaba yang berbasis di Afrika yang bertujuan untuk mempromosikan, mengembangkan, dan melindungi hak asasi manusia dari komunitas trans dan beragam gender di Afrika Selatan dan di seluruh Afrika bagian selatan. Organisasi ini melakukan advokasi, memfasilitasi pembangunan kapasitas, dan memberikan layanan langsung kepada komunitas. Mereka juga menawarkan sumber daya online terkait dengan kesehatan, program pendidikan, dan pengakuan gender secara hukum."},{"id":"47b17f76-670a-4835-8773-409d98934b91","slug":"sylvia-rivera-law-project","externalUrl":"https://srlp.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"address":"147 W 24th St #5th, New York, NY 10011, USA","phoneNumber":"212-337-8550","country":"US","provinceOrState":"NY","city":"New York","town":"Manhattan","county":"New York County","latLng":[40.744576,-73.9941166],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/sylvia-rivera-law-project-new-york?osq=sylvia+rivera+law+project","googleMapsUrl":"https://goo.gl/maps/sjGv8qoSZPe3XE2QA","facebookUrl":"https://www.facebook.com/sylviariveralawproject","twitterUrl":"https://www.twitter.com/srlp","instagramUrl":"https://instagram.com/sylviariveralawproject/","youtubeUrl":"https://www.youtube.com/user/SylviaRiveraLP","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Sylvia Rivera Law Project (SRLP)","description":"Sylvia Rivera Law Project bekerja untuk menjamin bahwa semua orang bebas menentukan identitas dan ekspresi gender mereka, terlepas dari pendapatan atau ras, dan tanpa menghadapi pelecehan, diskriminasi atau kekerasan. SRLP menyediakan bantuan hukum, mengorganisir kampanye, melakukan pelatihan, dan menjalankan Komite Penasihat Narapidana. Keterlibatan komunitas dianjurkan melalui donasi, sukarelawan, dan keanggotaan."},{"id":"499aa5dd-d3c0-42f6-a686-853672f3c71e","slug":"erin-in-the-morning","externalUrl":"https://www.erininthemorning.com/","tags":["transfeminine","legal","healthcare","education-awareness"],"email":"null","socialMedia":{"facebook":"facebook.com/erininthemorning","email":"mailto:info@erininthemorning.com"},"title":"Erin di Pagi Hari","description":"Berita dan diskusi tentang legislasi trans dan kehidupan. Oleh Erin Reed Â· Lebih dari 38.000 pelanggan"},{"id":"4be75e80-8ce1-4f46-90f0-ad307cd1829b","slug":"equaldexcom","externalUrl":"https://EqualDex.com","tags":["transfeminine","non-binary","transmasculine","partner-resources"],"title":"EqualDex.com","description":"Sebuah platform online inovatif yang bertujuan untuk menciptakan sumber daya yang komprehensif dan terkini tentang hak LGBTQ+ global. Situs web mereka menyediakan basis data sentralisasi dari undang-undang, kebijakan, dan sikap masyarakat terhadap hak LGBTQ+ dari seluruh dunia. Dengan memetakan dan memvisualisasikan data tentang kesetaraan, inklusivitas, dan perlindungan hukum, EqualDex.com menawarkan alat yang kuat untuk aktivis, peneliti, dan individu yang berusaha memahami dan advokasi untuk hak LGBTQ+ dalam skala global. Jelajahi peta interaktif mereka, telusuri profil negara tertentu, dan tetap terinformasi tentang kemajuan dan tantangan terbaru yang dihadapi komunitas LGBTQ+ di seluruh dunia."},{"id":"58738396-e4d7-424a-ba8d-59559e883f06","slug":"strandsfortransorg","externalUrl":"https://strandsfortrans.org","tags":["transfeminine","non-binary","transmasculine","friendly-businesses","makeup"],"title":"strandsfortrans.org","description":"Strands For Trans adalah jaringan global industri rambut, kecantikan, dan kesehatan serta organisasi yang berusaha untuk menciptakan dan menginspirasi pengalaman yang aman dan positif untuk semua tamu, khususnya tamu dari komunitas trans."},{"id":"594ba858-974c-4c09-8fd4-f4bb35ca6c5f","slug":"pacific-center-for-human-growth","externalUrl":"https://www.pacificcenter.org/","tags":["mental-health","support-groups","healthcare","youth-services","education-awareness"],"address":"2712 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"510-548-8283","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8611143,-122.2593404],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/pacific-center-berkeley","googleMapsUrl":"https://goo.gl/maps/dSnoipA7TWiDN72b7","facebookUrl":"https://www.facebook.com/pacific.center","twitterUrl":null,"instagramUrl":"https://www.instagram.com/pacificcenterberkeley/","youtubeUrl":"https://www.youtube.com/user/TheInQueery","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Pacific Center for Human Growth","description":"Didirikan pada tahun 1973, Pacific Center for Human Growth adalah pusat LGBTQIA+ tertua di Bay Area, yang ketiga tertua di negara ini, dan mengoperasikan satu-satunya klinik kesehatan mental dengan skala geser untuk orang-orang LGBTQIA+ dan QTBIPOC serta keluarga mereka di Kabupaten Alameda."},{"id":"682fba48-f668-4fe6-89a7-05a90193e778","slug":"oakland-lgbtq-community-center","externalUrl":"https://www.oaklandlgbtqcenter.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness","financial-aid-scholarships","community-stories","partner-resources"],"address":"3207 Lakeshore Ave, Oakland, CA 94610, USA","phoneNumber":"510-882-2286","country":"US","provinceOrState":"CA","city":"Oakland","county":"Alameda County","latLng":[37.8103802,-122.2459822],"socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://goo.gl/maps/EnhwARKBin25SAmA6","facebookUrl":"https://www.facebook.com/oaklandlgbtqcommunitycenter/?notify_field=blurb&modal=profile_completion&notif_t=page_profile_blurb&notif_id=1499829595947085","twitterUrl":null,"instagramUrl":"https://www.instagram.com/oaklandlgbtqcenter","youtubeUrl":"https://youtu.be/3qxj1a9esuU","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Pusat Komunitas LGBTQ Oakland","description":"Pertama kali di Oakland, organisasi non-profit 501c3, untuk semua usia, pusat pelayanan komunitas LGBTQ semuanya. Layanan yang ditawarkan meliputi kelompok dukungan, dukungan kesehatan mental, bantuan perumahan, program pemuda, klinik hukum, dapur umum, dll. Program khusus juga diselenggarakan untuk anggota komunitas LGBTQ+ yang berusia lanjut dan anggota komunitas transgender."},{"id":"7fb1e1a6-bd81-4515-9aaa-70aea4580e55","slug":"gender-diversity","externalUrl":"https://genderdiversity.org","tags":["education-awareness","healthcare","youth-services","support-groups","parent-family-resources","social-services","non-binary","transmasculine","transfeminine"],"address":"6523 California Ave SW #144, Seattle, WA 98136","country":"US","provinceOrState":"WA","city":"Seattle","county":"King County","latLng":[47.544046,-122.387452],"phoneNumber":"1-833-3GENDER","email":"info@genderdiversity.org","title":"Keragaman Gender","description":"Keragaman Gender meningkatkan kesejahteraan anak-anak dan orang dewasa dari semua identitas dan ekspresi gender dengan menyediakan pendidikan, meningkatkan kesadaran, dan menawarkan wawasan ke dalam rentang pengalaman manusia yang lebih luas. Kami juga membantu dalam menciptakan lingkungan yang mendukung dan tidak diskriminatif di sekolah, tim olahraga, tempat kerja, dan penyedia layanan kesehatan untuk individu transgender dan beragam gender."},{"id":"878e809b-12aa-483f-be01-3c51a4d331d6","slug":"national-center-for-transgender-equality","externalUrl":"https://transequality.org","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","education-awareness","financial-aid-scholarships"],"address":"1032 15th St NW #199, Washington, DC 20005, USA","phoneNumber":"(202) 642-4542","country":"US","provinceOrState":"CA","city":"Washington D.C.","county":"District of Columbia","latLng":[38.903438,-77.035037],"email":"ncte@transequality.org","socialMedia":{"blogUrl":"https://transequality.org/blog"},"title":"Pusat Nasional untuk Kesetaraan Transgender","description":"Pusat Nasional untuk Kesetaraan Transgender adalah sebuah organisasi yang berjuang untuk mengubah kebijakan dan sikap masyarakat agar memahami dan menerima orang-orang transgender. NCTE menyediakan informasi tentang berbagai isu yang mempengaruhi komunitas Transgender termasuk penuaan, anti-kekerasan, pekerjaan, keluarga, kesehatan & HIV, perumahan & tunawisma, dan lainnya."},{"id":"8a206480-e41f-4bb6-9128-94d4b04cd997","slug":"the-inner-circle","externalUrl":"https://theinnercircle.org.za/","tags":["education-awareness","support-groups","spiritual"],"address":"Lester Rd, Wynberg, Cape Town, 7824, South Africa","phoneNumber":"+27 (0) 21 761 0037","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-34.011883,18.469623],"email":"admin@theinnercircle.org.za","socialMedia":{"facebook":"https://www.facebook.com/pg/The-Inner-Circle-151896104833723/","twitter":"https://twitter.com/TIC_SouthAfrica"},"town":"Wynberg","title":"The Inner Circle","description":"Komunitas Muslim Global yang bertujuan membawa penyembuhan kepada Muslim yang termarginalisasi berdasarkan orientasi seksual dan identitas gender melalui spiritualitas, pendidikan, dan pembangunan gerakan"},{"id":"8ab7bb47-206d-4872-a3ca-e692ce2036ec","slug":"florida-name-change-home","externalUrl":"https://www.floridanamechange.org/","tags":["legal","social-services"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":"FL","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Beranda Penggantian Nama Florida","description":"Situs web ini menyediakan panduan langkah demi langkah untuk mereka yang ingin memperbarui nama atau jenis kelamin mereka di Florida. Langkah-langkah tersebut termasuk mengajukan permohonan di pengadilan, dan memperbarui kartu Jaminan Sosial, lisensi pengemudi, paspor, dan akta kelahiran."},{"id":"a453684e-c325-457f-8841-05c0adabbbc0","slug":"the-trevor-project","externalUrl":"https://www.thetrevorproject.org/","tags":["youth-services","support-groups","mental-health","education-awareness"],"address":"West Hollywood, CA 90069, USA","email":null,"phoneNumber":"(212) 695-8650","country":"US","provinceOrState":"CA","city":"West Hollywood","county":"Los Angeles County","latLng":[34.0931603,-118.3783347],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TheTrevorProject","twitterUrl":"https://twitter.com/trevorproject","instagramUrl":"https://www.instagram.com/trevorproject/","youtubeUrl":"https://www.youtube.com/thetrevorproject","tiktokUrl":"https://www.tiktok.com/@trevorproject","twitchUrl":null,"patreonUrl":null},"title":"The Trevor Project","description":"The Trevor Project adalah organisasi nirlaba Amerika yang menyediakan layanan pencegahan bunuh diri untuk pemuda LGBTQ+. Situs ini menyediakan sumber daya berharga bagi komunitas transgender, termasuk intervensi krisis dan garis hidup pencegahan bunuh diri, TrevorChat, dan TrevorText serta bimbingan tentang kesehatan mental, layanan sosial, dan kelompok dukungan."},{"id":"ab058b91-49cf-4733-b3a3-47ea59b31a78","slug":"a-place-for-marsha","externalUrl":"https://www.aplaceformarshaofficial.org/","tags":["transmasculine","non-binary","transfeminine","legal","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships","community-stories"],"email":"info@aplaceformarshaofficial.org","socialMedia":{"tiktok":"https://www.tiktok.com/@aplaceformarsha"},"title":"Sebuah Tempat untuk Marsha","description":"Sebuah Tempat untuk Marsha adalah salah satu dari banyak proyek start-up yang bertujuan untuk membantu individu dan keluarga Trans dalam negara yang semakin berbahaya menuju tempat yang lebih aman. APFM memulai perjalanannya pada Maret 2023 sebagai reaksi terhadap meningkatnya legislasi anti-trans di seluruh negeri. APFM sekarang berfokus pada mencocokkan Pengungsi dari negara merah sebagai teman sekamar, dengan hati-hati menangani satu rumah tangga dalam satu waktu."},{"id":"b6955ff7-83b4-464f-8be8-72a50dc6a878","slug":"transvoicelessons","externalUrl":"https://www.transvoicelessons.com/","tags":["voice-training"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":"https://www.youtube.com/c/transvoicelessons","tiktokUrl":null,"twitchUrl":null,"patreonUrl":"https://www.patreon.com/transvoicelessons/posts"},"title":"TransVoiceLessons","description":"TransVoiceLessons menawarkan layanan kontrol suara dan pembebasan berkualitas untuk individu transgender dan non-binary yang ingin suaranya terdengar lebih maskulin, feminin, atau androgen."},{"id":"cd48f2d0-8241-4fa5-a0aa-dc3cd3d386e8","slug":"rainbowrailroadorg","externalUrl":"https://RainbowRailroad.org","tags":["transfeminine","non-binary","transmasculine","legal","social-services"],"title":"RainbowRailroad.org","description":"Sebuah platform online penting yang didedikasikan untuk membantu dan membela individu LGBTQ+ yang menghadapi penganiayaan dan kekerasan di seluruh dunia. Dengan komitmen yang tidak goyah, website ini menghubungkan mereka yang berada dalam bahaya langsung ke sumber daya penyelamatan hidup, bantuan darurat, dan jalur aman ke keamanan. Melalui kemitraan dengan organisasi lokal dan jaringan pendukung yang penuh belas kasih, RainbowRailroad.org bekerja tanpa lelah untuk menyediakan advokasi, bantuan hukum, dan dukungan relokasi, memungkinkan individu untuk kabur dari penganiayaan dan menemukan perlindungan. Dengan memperjuangkan hak asasi manusia, menyelamatkan hidup, dan mendorong dunia yang lebih inklusif, RainbowRailroad.org berfungsi sebagai mercusuar harapan dan perlindungan bagi individu LGBTQ+ yang mencari keamanan dan kebebasan."},{"id":"d59c0a9f-14ff-4c55-94d6-82313925be14","slug":"the-mckenzie-project","externalUrl":"https://www.themckenzieproject.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":"8390 W Flagler St STE 201, Miami, FL 33144, USA","email":"Info@TheMcKenzieProject.org","phoneNumber":"305-846-3186","country":"US","provinceOrState":"FL","city":"Miami","county":"Miami-Dade County","latLng":[25.769445,-80.3321284],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Proyek McKenzie","description":"Sebuah sumber daya komprehensif yang menawarkan layanan, program dan acara yang bertujuan untuk mempromosikan keadilan gender dan melayani komunitas transgender. Termasuk layanan dukungan dan sumber daya termasuk kesehatan, bantuan hukum, layanan kesehatan mental dan lainnya."},{"id":"d7378cc4-7726-4de1-8427-8203cb9b61ad","slug":"east-bay-trans-queer-counseling","externalUrl":"https://www.eastbaytranscounseling.org/","tags":["transmasculine","non-binary","transfeminine","mental-health","social-services","youth-services","education-awareness"],"email":"eastbaytranscounseling@gmail.com","address":"3099 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"781-775-7802","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8538725,-122.2596505],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"East Bay Trans & Queer Counseling","description":"East Bay Trans & Queer Counseling menawarkan layanan skala bergerak yang mencakup: Terapi Individual yang berlokasi sentral di Berkeley, CA Dukungan melalui eksplorasi gender dan transisi Surat rekomendasi untuk hormon dan operasi Latihan profesional untuk penyedia layanan kesehatan mental, siswa, dan majikan. Sam Davis adalah seorang Pekerja Sosial Klinis Berlisensi (LCSW) transgender, genderqueer yang mengkhususkan diri dalam bekerja dengan remaja dan dewasa trans, queer, genderqueer, dan yang tidak sesuai gender. Mereka memiliki 16 tahun pengalaman sebagai penyedia layanan kesehatan mental di East Bay, termasuk fasilitasi kelompok dukungan sebaya, pendidikan komunitas di konferensi LGBTQI, dan 9 tahun praktik klinis dan konseling krisis dengan orang-orang yang sangat marginal untuk County of Alameda. Mereka adalah advokat yang kuat dan berkomitmen dengan sejarah panjang organisasi atas nama orang-orang yang termarginalisasi."},{"id":"eee5057f-7302-4392-b6aa-add70e3e8556","slug":"transgendermap","externalUrl":"https://transgendermap.com","tags":["transfeminine","non-binary","transmasculine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"title":"Peta Transgender","description":"Transgendermap.com adalah sumber daya online yang bertujuan untuk memberikan informasi praktis dan panduan kepada orang yang sedang mempertanyakan identitas gender mereka atau berada di suatu tempat dalam spektrum transgender. Situs web ini mencakup berbagai topik seperti pemahaman terminologi transgender, proses transisi, masalah hukum, kesehatan, dan banyak cerita pribadi. Tujuannya adalah untuk membantu individu menavigasi perjalanan pribadi mereka dengan menyediakan \'peta\' atau panduan untuk berbagai aspek identitas gender dan pengalaman transgender. Silakan kunjungi situs aslinya untuk informasi yang paling baru dan akurat."},{"id":"fc8a7875-84dd-4df5-96ec-8aca153c8ea6","slug":"trans-families-home","externalUrl":"https://transfamilies.org","tags":["transmasculine","non-binary","transfeminine","parent-family-resources","support-groups","education-awareness"],"email":null,"phoneNumber":null,"address":null,"socialMedia":null,"title":"Keluarga Trans","description":"Keluarga Trans menginspirasi harapan, meningkatkan pemahaman, dan menciptakan jalur yang terlihat untuk mendukung anak-anak trans dan beragam gender serta semua orang yang menyentuh hidup mereka. Kami menyediakan sumberdaya, mengorganisir acara, dan menghubungkan keluarga ke grup dukungan."}]')}}]);